import React from 'react'
import './Menu.css'
import menuItems from './MenuItems'
function Menu() {
  return (
    <div className='menu-main'>
      <h2>Sections</h2>
        {menuItems.map(({name, cName, path, dropdown}) => {
            return (
                <button className={cName}>{dropdown ? dropdown[0] : null}{name}</button>
            )
        })}
    </div>
  )
}

export default Menu
